    for char in text:
        if char == ' ':
            consecutive_spaces += 1
            if consecutive_spaces > 2:
                new_text = new_text[:-1] + '-'
            elif consecutive_spaces == 2:
                new_text = new_text[:-1] + '_'
            else:
                new_text += '_'
        else:
